import React from 'react';
//import './App.css';
import Header from './Header';
import Home from "./Home";

import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'

function App() {
  return (
    <Router>
    <div className="App">
      <Switch>
        <Route path="/checkout">
        <Header />
          <h1>Checkout</h1>
        </Route>
        <Route path="/login">
          <h1>Login page</h1>
        </Route>
        <Route path="/">
          <Header />
          <h1>Home page</h1>

        </Route>
      </Switch>
    </div>
    </Router>
  );
}

export default App;
